INSERT INTO `ws_article_foo` (`ws_article_id`, `ws_article_date_create`, `ws_article_date_update`, `ws_article_category_id`, `ws_article_title`, `ws_article_summary`, `ws_article_desc`, `ws_article_slug`, `ws_article_path`, `ws_article_image_1`, `ws_article_keyword`, `ws_article_tags`, `ws_user_create`, `ws_user_update`, `ws_article_status_publish`, `ws_article_undelete`, `ws_article_metatitle`, `ws_article_metakeyword`, `ws_article_metadesc`) VALUES
(2, '1524565162', '1555915745', 0, 'Pembangunan Mesjid AL-MUTTAQIEN YP IPPI PETOJO', 'pembangunan masjid', '<p><span style=\"font-size: medium;\">Kehidupan dunia ini tidak abadi. Tak lama ajal akan datang menjemput. Dunia hanyalah alam tempat ujian dan kefanaan. Sudah sepatutnya bagi seorang muslim yang beriman akan surga dan neraka, mempersiapkan bekal untuk memberatkan timbangan amal kebajikannya. Demi meraih kebahagiaan hakiki dan abadi.</span></p>\r\n<p><span style=\"font-size: medium;\">Sejak jauh hari, Nabi kita shallallahuaalaihi wasallam mengingatkan hal ini,</span></p>\r\n<p><span style=\"font-size: medium;\">\"Orang yang pandai itu ialah, orang yang mampu mengevaluasi dirinya dan beramal (mencurahkan semua potensi) untuk kepentingan setelah mati. Sedangkan orang yang lemah ialah, orang yang mengikuti hawa nafsunya kemudian berangan-angan kosong kepada Allah.\" (HR.Tirmidzi)</span></p>', '2018/04/24/12/19/22/pembangunan-mesjid-al-muttaqien-yp-ippi-petojo', '', '', '', 'pembangunan masjid', 'admins', 'admins', '1', '0', '', 'demo, atikel', ''),
(3, '1524566660', '1555914361', 0, 'Informasi Ujian Seleksi PPDB 2018-2019', 'informasi penerimaan ujian seleksi PPDB 2018-2019 (Penerimaan Peserta Didik Baru)', '<p><strong><span style=\"font-size: medium;\">Unit SMP :</span></strong></p>\r\n<ul>\r\n<li><span style=\"font-size: medium;\">Calon siswa baru harus mengikuti ujian tertulis yang terdiri materi soal campuran (matematika, IPA, Pengetahuan Umum, B </span><span style=\"font-size: medium;\">Indonesia, & B. Inggris materi SD).</span></li>\r\n<li><span style=\"font-size: medium;\">Untuk calon siswa pindahan, materi ujian tertulis adalah soal-soal umum yang telah dipelajari di kelas sebelumnya.</span></li>\r\n<li><span style=\"font-size: medium;\">Calon siswa didampingi oleh Orang tua harus mengikuti test wawancara dengan Guru SMP, berkaitan dengan peraturan Tata Tertib & Budaya Sekolah.</span></li>\r\n</ul>\r\n<p> </p>\r\n<p><strong><span style=\"font-size: medium;\">Unit SMA :</span></strong></p>\r\n<ul>\r\n<li><span style=\"font-size: medium;\">Calon siswa baru harus mengikuti ujian tertulis yang terdiri materi soal campuran yaitu Matematika, Bahasa Indonesia, Bahasa Inggris, & Mata Pelajaran Umum (IPA & IPS) materi SMP.</span></li>\r\n<li><span style=\"font-size: medium;\">Untuk calon siswa pindahan, materi ujian tertulis adalah soal-soal umum yang telah dipelajari di kelas sebelumnya</span></li>\r\n<li><span style=\"font-size: medium;\">Calon siswa didampingi oleh Orang tua harus mengikuti test wawancara dengan Guru SMA, berkaitan dengan peraturan Tata Tertib & Budaya Sekolah.</span></li>\r\n</ul>\r\n<p> </p>\r\n<p><span style=\"font-size: medium;\"><strong>Unit SMK : </strong></span></p>\r\n<ul>\r\n<li><span style=\"font-size: medium;\">Calon siswa baru harus mengikuti ujian tertulis yang terdiri materi soal campuran (Matematika, Bahasa Indonesia, & Bahasa Inggris materi SMP).</span></li>\r\n<li><span style=\"font-size: medium;\">Untuk calon siswa pindahan, materi ujian tertulis adalah soal-soal umum yang telah dipelajari di kelas sebelumnya</span></li>\r\n<li><span style=\"font-size: medium;\">Calon siswa didampingi oleh Orang tua harus mengikuti test wawancara dengan Guru SMK, berkaitan dengan peraturan Tata Tertib & Budaya Sekolah.</span></li>\r\n</ul>', '2018/04/24/12/44/20/informasi-ujian-seleksi-ppdb-2018-2019', '', '', '', 'ppdb, Penerimaan Peserta Didik Baru', 'admins', 'admins', '1', '0', '', 'demo, berita', ''),
(4, '1525455125', '1555911272', 0, 'INFORMASI WISUDA / PELEPASAN SMA-SMK YP IPPI PETOJO & CAKUNG', 'Setelah melalui perjuangan yang panjang, siswa-siswi kelas XII telah menyelesaikan pendidikannya dengan hasil LULUS 100%.', '<p class=\"MsoNormal\" style=\"margin: 15.75pt 0in 7.9pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-align: center;\" align=\"center\"><span style=\"font-size: medium;\"><strong><span style=\"font-family: Andalus, serif; color: #222222;\"><span>UNDANGAN WISUDA/PELEPASAN</span></span></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-indent: 0.25in; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-align: justify;\"><span style=\"font-size: medium;\"><span style=\"line-height: 150%; font-family: Andalus, serif; color: #222222; border: 1pt none windowtext; padding: 0in;\">Setelah melalui perjuangan yang panjang, siswa-siswi kelas XII telah menyelesaikan pendidikannya di SMA dan SMK YP IPPI Petojo & Cakung ( JAKARTA) selama 3 tahun, dan telah mengikuti serangkaian kegiatan mulai USBN & UNBK, dengan hasil <strong>LULUS 100%.</strong></span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-indent: 0.25in; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-align: justify;\"><span style=\"line-height: 150%; font-family: Andalus, serif; color: #222222; font-size: medium;\"><span> </span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-indent: 0.25in; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-align: justify;\"><span style=\"line-height: 150%; font-family: Andalus, serif; color: #222222; font-size: medium;\"><span> <span style=\"border: none windowtext 1.0pt; mso-border-alt: none windowtext 0in; padding: 0in;\">Selamat untuk kalian semua siswa-siswi  kelas XII semoga keberhasilan ini merupakan awal dari kesuksesan dimasa yang akan datang.</span></span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-indent: 0.25in; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-align: justify;\"><span style=\"line-height: 150%; font-family: Andalus, serif; color: #222222; font-size: medium;\"><span> </span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-indent: 0.25in; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-align: justify;\"><span style=\"line-height: 150%; font-family: Andalus, serif; color: #222222; font-size: medium;\"><span><span style=\"border: none windowtext 1.0pt; mso-border-alt: none windowtext 0in; padding: 0in;\">Dalam rangka mengakhiri kegiatan pendidikan di SMA dan SMK YP IPPI Petojo & Cakung ( JAKARTA), mengharap atas kehadiran siswa-siswi  XII pada :</span></span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: 150%; background-image: initial; background-p