-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;\"><span style=\"font-size: medium;\"><span><span style=\"line-height: 150%; font-family: Andalus, serif; color: #222222; border: 1pt none windowtext; padding: 0in;\"><strong>Putra</strong> : </span><span style=\"line-height: 150%; font-family: Helvetica, sans-serif; color: #222222;\">Memakai kemeja lengan panjang berdasi</span><span style=\"line-height: 150%; font-family: Andalus, serif; color: #222222; border: 1pt none windowtext; padding: 0in;\"> menggunakan Jas</span></span></span></li>\r\n<li class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;\"><span style=\"font-size: medium;\"><span style=\"text-indent: 0.5in; line-height: 150%; font-family: Andalus, serif; color: #222222; border: 1pt none windowtext; padding: 0in;\"><span><strong>Putri</strong> : </span></span><span style=\"text-indent: 0.5in; line-height: 150%; font-family: Helvetica, sans-serif; color: #222222;\"><span>Memakai kebaya (pakaian resmi Nasional).</span></span></span></li>\r\n</ul>', '2018/05/04/07/32/05/informasi-wisuda--pelepasan-sma-smk-yp-ippi-petojo--cakung', '', '', '', 'undangan wisdua', 'admins', 'admins', '1', '0', '', 'UNDANGAN WISUDA', ''),
(5, '1525513247', '1555910019', 0, 'JADWAL PEMBAGIAN CETAK SKL', 'jadwal cetak SKL', '<p style=\"text-align: justify;\"><span style=\"font-size: medium;\"><strong>SMK YP IPPI CAKUNG</strong></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: medium;\">Hari : Senin s.d Rabu</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: medium;\">Tanggal : 7 Mei s.d 9 Mei 2018</span></p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: medium;\"><strong>SMK YP IPPI PETOJO</strong></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: medium;\">Hari : Kamis s.d Jumat</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: medium;\">Tanggal : 10 Mei s.d 12 Mei 2018</span></p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: medium;\"><strong>SMA YP IPPI CAKUNG</strong></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: medium;\">Hari : Senin s.d Rabu</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: medium;\">Tanggal : 14 Mei s.d 16 Mei 2018</span></p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: medium;\"><strong>SMA YP IPPI PETOJO</strong></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: medium;\">Hari : Kamis s.d Jumat</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: medium;\">Tanggal : 17 Mei s.d 19 Mei 2018</span></p>', '2018/05/05/11/40/47/jadwal-pembagian-cetak-skl', '', '', '', 'jadwal', 'admins', 'admins', '1', '0', '', 'JADWAL PEMBAGIAN CETAK SKL', ''),
(6, '1525759868', '1555581092', 0, 'LSP YP IPPI', 'Lembaga sertifikasi profesi adalah lembaga pendukung BNSP yang bertanggung jawab melaksanakan sertifikasi kompetensi profesi', '<p style=\"text-align: justify;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\">Lembaga sertifikasi profesi adalah lembaga pendukung BNSP yang bertanggung jawab melaksanakan sertifikasi kompetensi profesi. LSP SMK YP IPPI PETOJO yang dibentuk berbadan hukum dan dibentuk oleh Lembaga Pendidikan dan Pelatihan yang diregistrasi oleh BNSP.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\">LSPSMK YP IPPI PETOJOmempunyai tugas mengembangkan standar kompetensi, melaksanakan uji kompetensi, menerbitkan sertifikat kompetensi serta melakukan verifikasi tempat uji kompetensi.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\">Dalam melaksanakan tugas dan fungsi, LSPSMK YP IPPI PETOJOmengacu pada pedoman yang dikeluarkan oleh BNSP. Dalam pedoman tersebut ditetapkan persyaratan yang harus dipatuhi untuk menjamin agar lembaga sertifikasi menjalankan sistem sertifikasi pihak pertama secara konsisten dan profesional, sehingga dapat diterima di tingkat nasional yang relevan demi kepentingan pengembangan sumber daya manusia dalam aspek peningkatan kualitas dan perlindungan tenaga kerja.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\"><strong>VISI :</strong></span><br /><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\">Menjadi lembaga sertifikasi profesi yang menjamin kompetensi tenaga kerja yang mampu bersaing,professional, berakhlak mulia dan berwawasan lingkungan.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\"><strong>MISI</strong></span></p>\r\n<ol>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\">LSP SMK YP IPPI PETOJO menjamin menerapkan pedoman BNSP tahun 2014 dan  ISO 17024</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\">LSPSMK YP IPPI PETOJOsiap melaksanakan sertifikasi kompetensi secara profesional dan mampu bersaing.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\">Memberikan pelayanan uji  sertifikasi kompetensi yang mengutamakan mutu dan kepuasan pelanggan .</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\">LSPSMK YP IPPI PETOJO menjamin ketidakperpihakan ,kejujuran, kedisiplinan dan berwawasan lingkungan.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\">Menghasilkan tenaga kerja  bersertifikat kompetensi yang profesional dan berakhlak mulia.</span></li>\r\n</ol>', '2018/05/08/08/11/08/lsp-yp-ippi', '', '', '', 'lembaga', 'admins', 'admins', '1', '0', '', 'A. VISI : Menjadi lembaga sertifikasi profesi yang menjamin kompetensi  tenaga kerja yang mampu bersaing,professional, berakhlak mulia dan berwawasan lingkungan.B. MISI1. LSP SMK YP IPPI PETOJO menjamin menerapkan pedoman BNSP tahun 2014 dan  ISO 17024 2. LSPSMK YP IPPI PETOJOsiap melaksanakan sertifikasi kompetensi secara profesional dan mampu bersaing.3. Memberikan pelayanan uji  sertifikasi kompetensi yang mengutamakan mutu dan kepuasan pelanggan .4. LSPSMK YP IPPI PETOJO menjamin ketidakperpihakan ,kejujuran, kedisiplinan dan berwawasan lingkungan.5. Menghasilkan tenaga kerja  bersertifikat kompetensi yang profesional dan berakhlak mulia.', ''),
(7, '1526219789', '1555580632', 0, 'Kegiatan Wisuda Kelas XII SMA-SMK YP IPPI Jakarta', 'Begitu khidmadnya kegiatan ini hingga tak sedikit yang meneteskan air mata saat menyanyikan lagu terimakasih Guruku.', '<div style=\"text-align: justify;\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: 15pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 9.0pt;\">Pada tanggal 9 Mei lalu, SMA-SMK YP IPPI Jakarta menyelenggarakan kegiatan pelepasan siswa-siswi kelas XII di Gedung Sasana Kriya TMII. Begitu khidmadnya kegiatan ini hingga tak sedikit yang meneteskan air mata saat menyanyikan lagu terimakasih Guruku.<br /> <br /> Pengalungan gordon merupakan tanda siap dilepaskannya para wisudawan. Satu per satu nama wisudawan dipanggil untuk melaksanakan prosesi sakral ini. Tiga tahun menggali ilmu, kini saatnya menebarkan manfaat atas ilmu yang dimiliki. Kurang lebih begitulah makna pada sesi ini.<br /> &lt;!--[if !supportLineBreakNewLine]--&gt;<br /> &lt;!--[endif]--&gt;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: 15pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 9.0pt;\">Di mana ada pertemuan, maka akan ada perpisahan. Begitulah pepatah mengatakan. Tak luput pula perkataan pepatah ini juga berlaku kepada para wisudawan SMA-SMK YP IPPI Jakarta. <br /><br />Setelah 3 tahun berkumpul, kini saatnya menempuh jalan masing-masing untuk menggapai tiap mimpi yang tertoreh di hati apakah melanjutkan kuliah atau berkerja nantinya.<br /><br /> &lt;!--[endif]--&gt;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: 15pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 9.0pt;\">Perpisahan hari ini bukan untuk dikenang atau ditangisi. Tetapi perpisahan hari ini adalah untuk dilewatkan. Karena bagaimanapun juga perpisahan adalah awal perjalanan hidup yang masih panjang. <br /></span><span style=\"font-size: 9pt;\"><br />Demikianlah hingga ditutuplah acara wisuda ini dengan pembacaan doa bersama yang dipimpin oleh Guru Agama Bpk Hilman.</span></p>\r\n</div>', '2018/05/13/03/56/29/kegiatan-wisuda-kelas-xii-sma-smk-yp-ippi-jakarta', '', '', '', '', 'admins', 'admins', '1', '0', '', 'wisuda,wisuda yp ippi,wisuda sma smk yp ippi,', ''),
(8, '1526470668', '1555580540', 0, 'Tim Futsal YP IPPI Juara Ke Dua di Tyfo Cup 2018', 'Tim futsal SMA-SMK YP IPPI berhasil meraih prestasi sebagai juara kedua pada kejuaraan Tyfo Cup X  2018.', '<div style=\"text-align: justify;\">\r\n<p class=\"MsoNormal\" style=\"text-align: justify; margin-bottom: 0.0001pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><strong><span style=\"font-size: 10.0pt;\">www.ypippijkt.sch.id -</span></strong><span style=\"font-size: 10.0pt;\"> Tim futsal SMA-SMK YP IPPI berhasil meraih prestasi sebagai juara kedua pada kejuaraan Tyfo Cup X  2018 yang diadakan di Sekolah SMA Negeri 44 Duren Sawit, Jakarta Timur. </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; margin-bottom: 0.0001pt; line-height: 12.1pt;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; margin-bottom: 0.0001pt; line-height: 12.1pt;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: #2a2a2a; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Tim futsal YP IPPI harus mengakui keunggulan tim Tuan rumah SMA Negeri 44 dengan skor 3 - 2 pada partai final. \"Kami sudah bermain cukup bagus dengan skuad pemain yang relatif muda, adapun menang kalah itu hal biasa, bagi kami yang penting pengalaman dan persahabatan antara sesama siswa antar sekolah,\" tutur Joko Sumarno selaku Pelatih team futsal SMA-SMK YP IPPI Cakung. </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; margin-bottom: 0.0001pt; line-height: 12.1pt;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; margin-bottom: 0.0001pt; line-height: 12.1pt;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: #2a2a2a; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Turnamen Tyfo Cup X ini merupakan Turnamen ke dua yang di ikuti oleh tim futsal YP IPPI selain untuk lebih banyak memberikan jam terbang bagi pemain yang kelas X dan tentunya pengalaman bertanding untuk turnamen besar lainnya.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; margin-bottom: 0.0001pt; line-height: 12.1pt;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; margin-bottom: 0.0001pt; line-height: 12.1pt;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: #2a2a2a; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Turnamen ini diikuti oleh tim-futsal terbaik Se-Jabodetabek. Perjuangan dan kerja keras futsal YP IPPI patut di acungi jempol dalam kiprahnya sudah empat piala yang mereka raih. </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; margin-bottom: 0.0001pt; line-height: 12.1pt;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: 12.1pt;\"> </p>\r\n<div style=\"text-align: justify;\"><span style=\"color: #2a2a2a; font-family: Verdana, sans-serif; font-size: 10pt;\">Seperti salah satunya piala O2SN dimana tim futsal YP IPPI berhasil menjadi yang terbaik dan menjadi juara pertama sekecamatan Cakung. </span></div>\r\n<div style=\"text-align: justify;\"><span style=\"color: #2a2a2a; font-family: Verdana, sans-serif;\"><span style=\"font-size: 13.3333px;\"> </span></span></div>\r\n<div style=\"text-align: justify;\"><span style=\"font-size: 10pt;\">Dimana waktu itu sekolah YP IPPI ditunjuk untuk menjadi tuan rumah. Kita doakan saja semoga kedepannya tim futsal YP IPPI SMA maupun SMK semakin jaya dan kembali membawa piala lainnya ke sekolah kita amieen.</span></div>\r\n<p> </p>\r\n<p class=\"MsoNormal\"> </p>\r\n<p class=\"MsoNormal\"><span style=\"line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"> </span></p>\r\n<div style=\"text-align: center;\"><img src=\"https://i.imgur.com/CoT9yX3.jpg\" alt=\"\" width=\"420\" /></div>\r\n&lt;!--[if !supportLineBreakNewLine]--&gt; &lt;!--[endif]--&gt;\r\n<p> </p>\r\n</div>', '2018/05/16/01/37/48/tim-futsal-yp-ippi-juara-ke-dua-di-tyfo-cup-2018', '', '', '', '', 'admins', 'admins', '1', '0', '', 'futsal yp ippi,tyfo cup 2018,', ''),
(9, '1526980499', '1555580408', 0, 'Kegiatan Belajar Mengajar ( KBM ) di Sekolah YP IPPI', 'Dengan kegiatan tadarus tersebut, Pihak sekolah dapat ikut menanamkan nilai-nilai keimanan dan ketakwaan terhadap para siswanya selama berada di sekolah.', '<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;\"><strong><span style=\"font-size: 10.0pt;\">1. Membaca Al-Quran Sebelum Belajar</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 10.0pt; line-height: 115%;\"><br /> </span><span style=\"font-size: 10pt; line-height: 115%; font-family: Verdana, sans-serif; color: #323233; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Suara lantunan ayat-ayat suci yang dibacakan serempak oleh para siswa pun seolah memenuhi setiap ruangan. Suasana syahdu nan indah lantunan alquran pun begitu terasa. Terlebih  tak hanya Siswa  SMP IT yang bertadarus, namun semua siswa SMA dan SMK YP IPPI.<br /> <br /> Dengan kegiatan tadarus tersebut, Pihak sekolah dapat ikut menanamkan nilai-nilai keimanan dan ketakwaan terhadap para siswanya selama berada di sekolah. </span><span style=\"font-size: 10pt; line-height: 115%; font-family: Verdana, sans-serif; color: #2d2d2d; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Dampak langsung dari membaca Alquran, kata Abdul Basit Siswa Kls XII bisa menghafal surat-surat pendek yang ada di dalam Alquran. <br /> </span><span style=\"font-size: 10.0pt; line-height: 115%;\"><br /> <strong>2. Literasi Sekolah</strong></span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 12pt 0cm; text-align: justify; line-height: 15.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: #2a2a2a; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Sekolah berperan penting dalam mengembangkan kreativitas siswa dan guru untuk mendongkrak literasi bangsa. Sekolah dapat mengembangkan keunggulan dalam literasi yang dimulai dari membaca hingga menulis.<br /> <br /> Di sekolah YP IPPI Jakarta tidak hanya menyediakan perpustakaan dengan fasilitas buku-buku yang menarik dan ruangan perpustakaan nyaman, tetapi pembelajaran di sekolah pun dimanfaatkan untuk meningkatkan literasi siswa.</span><span style=\"font-size: 10.0pt;\"><br /> </span><strong><span style=\"font-size: 10.0pt;\"><br /> 3. Jumat  Berkah<br /></span></strong><img src=\"https://i.imgur.com/rI7IWU7.jpg\" alt=\"\" width=\"420\" /></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 10pt; line-height: 115%; font-family: Verdana, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Seluruh Siswa/Siswi Guru dan juga karyawan SMP-SMA-SMK YP IPPI Jakarta, membaca surah Yasin sebelum memasuki ruang kelas, setiap Jumat. Hal tersebut berguna untuk melatih para murid menanamkan nilai-nilai keimanan di sekolah.</span></p>\r\n<p style=\"margin: 12pt 0cm; text-align: justify; line-height: 15.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;\"><span style=\"font-size: 10pt; font-family: Verdana, sans-serif; color: #262626; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Salah seorang guru, Bpk Arpan Siregar, Jumat (18/5/2018) mengatakan, kegiatan tersebut bertujuan untuk menambah keimanan dan ketaqwaan para murid kepada Alloh SWT. Siangnya dilanjutkan dengan shalat Jumat bersama Siswa Guru dan karyawan.</span><span style=\"font-size: 10.0pt;\"><br /> <br /> <strong>4. Study Tour<br /></strong><img src=\"https://i.imgur.com/s4x0hZm.jpg\" alt=\"\" width=\"420\" /></span></p>\r\n<p style=\"margin: 12pt 0cm; text-align: justify; line-height: 15.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;\"><span style=\"font-size: 10.0pt;\">Diselenggarakan di akhir  tahun ajaran, untuk mengajak anak-anak ke obyek-obyek wisata, seperti museum atau tempat-tempat lain yang dipilih. Kegiatan ini selain menyenangkan bagi anak-anak juga menambah  ilmu pengetahuan setelah mengikuti pembelajaran selama satu tahun ajaran di kelas. Serta  kegiatan ini tidak memberatkan bagi orang tua dari segi pendanaan.</span></p>\r\n<p style=\"margin: 12pt 0cm; text-align: justify; line-height: 15.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;\"><strong><span style=\"font-size: 10.0pt;\"> 5. Kesehatan<br /></span></strong><img src=\"https://i.imgur.com/DQD999V.jpg\" alt=\"\" width=\"420\" /></p>\r\n<p style=\"margin: 12pt 0cm; text-align: justify; line-height: 15.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;\"><span style=\"font-size: 10.0pt;\">Bekerjasama dengan PUSKESMAS di lingkungan SMP-SMA-SMK YP IPPI, pemeriksaan gigi, mata dan kesehatan pada umumnya rutin dilakukan tanpa dipungut biaya. Imunisasi juga dilakukan mengikuti program imunisasi yang didanai oleh pemerintah, menjadikan anak murid lebih terpantau dan terjaga kesehatannya.</span></p>\r\n<p style=\"margin: 12pt 0cm; text-align: justify; line-height: 15.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;\"><strong><span style=\"font-size: 10.0pt;\"> 6. Pramuka<br /></span></strong><img src=\"https://i.imgur.com/PG0P9az.jpg\" alt=\"\" width=\"420\" /></p>\r\n<p style=\"margin: 12pt 0cm; text-align: justify; line-height: 15.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;\"><span style=\"font-size: 10.0pt;\">Ekstra kulikuler ini mendidik murid-murid agar memiliki jiwa kepemimpinan, kebersamaan, suka menolong dan gotong royong. Nilai-nilai dasar yang selama ini hampir dilupakan oleh sekolah-sekolah yang lain. Penanaman nilai-nilai ini dilakukan dengan berbagai macam kegiatan yang melibatkan seluruh anggota pramuka.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 10.0pt; line-height: 115%;\"> </span></p>', '2018/05/22/11/14/59/kegiatan-belajar-mengajar--kbm--di-sekolah-yp-ippi', '', '', '', '', 'admins', 'admins', '1', '0', '', 'KEGIATAN KBM', ''),
(10, '1527060390', '1555580231', 0, 'YP IPPI Juara ( 1 ) O2SN Pencak Silat Jakarta Timur Wilayah Satu', 'Olimpiade Olahraga Siswa Nasional atau biasa disingkat ( O2SN )', '<div style=\"text-align: justify;\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Verdana, sans-serif; font-size: 10pt;\">Olimpiade Olahraga Siswa Nasional atau biasa disingkat ( O2SN ) merupakan program pembinaan kesiswaan yang diselenggarakan Direktorat Pembinaan Sekolah Menengah Atas ( SMA ) Direktorat Jenderal Pendidikan Dasar dan Menengah, Kementerian Pendidikan dan Kebudayaan sejak tahun 2008. </span></p>\r\n<div style=\"text-align: justify;\"><span style=\"font-family: Verdana, sans-serif;\"><span style=\"font-size: 13.3333px;\"> </span></span></div>\r\n<div style=\"text-align: justify;\"><span style=\"font-size: 10pt;\">Untuk jengjang SMA mempertandingkan 5 ( lima ) cabang olahraga, yaitu : Karate, Pencak Silat, Atletik, Bulu Tangkis, dan Renang.</span></div>\r\n<div style=\"text-align: justify;\"><span style=\"font-size: 10pt;\"> </span></div>\r\n<div style=\"text-align: justify;\"><span style=\"font-family: Verdana, sans-serif; font-size: 10pt;\">O2SN diselenggarakan dengan tujuan untuk memfasilitasi, memotivasi, dan juga mengembangkan bakat, minat,  dan prestasi siswa di bidang olahraga. </span></div>\r\n<div style=\"text-align: justify;\"><span style=\"font-family: Verdana, sans-serif;\"><span style=\"font-size: 13.3333px;\"> </span></span></div>\r\n<div style=\"text-align: justify;\"><span style=\"font-size: 10pt;\">Selain itu, O2SN merupakan ajang pembinaan dan penumbuhan karakter siswa, baik dalam sikap, mental, seportivitas, kejujuran, dan solidaritas, seiring dengan upaya penguatan pendidikan karakter. </span></div>\r\n<div style=\"text-align: justify;\"> </div>\r\n<div style=\"text-align: justify;\"><span style=\"font-size: 10pt;\">kehadiran anak-anak berbakat dari penjuru Indonesia dalam ajang ini juga sebagai sarana untuk membangun rasa kebersamaan dan persatuan sebagai generasi penerus bangsa. </span></div>\r\n<div style=\"text-align: justify;\"> </div>\r\n<div style=\"text-align: justify;\"><span style=\"font-size: 10pt;\">Selamat untuk Ananda Nafa menjadi Juara 1 ( satu ) O2SN Pencak Silat Jakarta Timur Wilayah 1 ( satu )</span></div>\r\n<div style=\"text-align: justify;\"><span style=\"font-size: 10pt;\"> </span></div>\r\n</div>', '2018/05/23/09/26/30/yp-ippi-juara--1--o2sn-pencak-silat-jakarta-timur-wilayah-satu', '', '', '', '', 'admins', 'admins', '1', '0', '', 'pencak silat', '');
