(17, '1585970652', '1586771752', 0, '2020-04-04 10:22', 'PPDB Online YP IPPI Jakarta', 'Teknologi sudah mulai dimanfaatkan dalam berbagai hal. Lembaga pendidikan sudah mulai melengkapi segala bentuk aktifitas dengan memanfaatkan teknologi yang ada.', '<p>Yayasan Pendidikan IPPI Jakarta melaksanakan Penerimaan Peserta Didik Baru secara daring. Hal ini dilakukan demi terciptanya lembaga pendidikan yang berteknologi dan menghindari terjadinya kerumunan dalam rangka mentaati instruksi Gubernur DKI Jakarta dalam mengurangi resiko penularan wabah Covid-19 yang sampai saat ini masih terjadi, dan kita semua berharap semoga cepat berakhir.</p>\r\n<p>Bagi para calon peserta didik yang ingin mendaftarkan diri di SMP, SMA, dan SMK YP IPPI Jakarta, silahkan klik link di bawah ini serta isi data dengan benar dan lengkap.</p>\r\n<p><strong>FORM PENDAFTARAN PPDB ONLINE :</strong></p>\r\n<p>SMP IT - SMA - SMK YP IPPI PETOJO : <strong><a href=\"https://s.id/daftar-ypippi-petojo\">https://s.id/daftar-ypippi-petojo</a></strong></p>\r\n<p>SMP - SMA - SMK YP IPPI IT CAKUNG : <strong><a href=\"https://docs.google.com/forms/d/e/1FAIpQLSdC7mDxE2LqXqBfrXALaS_VLCs07vljXzSbDs9VZbCAJ9FfaA/viewform?usp=sf_link\">https://bit.ly/daftar-ppdb-ypippickg</a></strong></p>\r\n<p><strong>FORM PEMBAYARAN PPDB ONLINE :</strong></p>\r\n<p>SMP IT - SMA - SMK YP IPPI PETOJO : <strong><a href=\"https://s.id/bayar-ypippi-petojo\">https://s.id/bayar-ypippi-petojo</a></strong></p>\r\n<p>SMP - SMA - SMK YP IPPI IT CAKUNG : <strong><a href=\"https://docs.google.com/forms/d/e/1FAIpQLSd0MXkHQxevx6FsFeFgmab6_DqELpUAVj8HUngFOpTgWKBgcw/viewform?usp=sf_link\">https://bit.ly/bayar-ppdb-ypippickg</a></strong></p>', '2020/04/04/10/24/12/ppdb-online-yp-ippi-jakarta', '', '', '', 'YPIPPI', 'admins', 'admins', '1', '0', '', '', '');
